import React from "react";
import ReactDOM from "react-dom";

const Header = props => <h1>{props.course}</h1>;

const Part = props => (
  <p>
    {props.partName} {props.partExercises}
  </p>
);

const Content = props => (
  <div>
    <Part partName={props.parts[0]} partExercises={props.exercises[0]} />
    <Part partName={props.parts[1]} partExercises={props.exercises[1]} />
    <Part partName={props.parts[2]} partExercises={props.exercises[2]} />
  </div>
);

const Total = props => (
  <p>
    yhteensä {props.exercises[0] + props.exercises[1] + props.exercises[2]}{" "}
    tehtävää
  </p>
);

const App = () => {
  const course = "Half Stack -sovelluskehitys";
  const part1 = "Reactin perusteet";
  const exercises1 = 10;
  const part2 = "Tiedonvälitys propseilla";
  const exercises2 = 7;
  const part3 = "Komponenttien tila";
  const exercises3 = 14;

  return (
    <div>
      <Header course={course} />
      <Content
        parts={[part1, part2, part3]}
        exercises={[exercises1, exercises2, exercises3]}
      />
      <Total exercises={[exercises1, exercises2, exercises3]} />
    </div>
  );
};

ReactDOM.render(<App />, document.getElementById("root"));
